'use strict'

//Object.getOwnPropertyDescriptor()
function polifill(target, key, value){
	if(target[key] !== undefined)return;
	Object.defineProperty(target, key, {
		configurable:true,
		writable:true,
		enumerable:false,
		value
	});
}

polifill(Object, 'fromEntries', function(iterable){
	let result = {};
	for(let [k, v] of iterable){
		result[k] = v;
	}
	return result;
})

